function App() {
  return (
    <Grid container direction='column'>
      <Box
        sx={{
          height: "100vh",
          display: "flex",
          flexDirection: 'column',
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography variant="h1">Fato ou Fake?</Typography>
        <Typography variant="article">Um algorítimo de machine learning capaz</Typography>
      </Box>
      <Box
        sx={{
          height: "100vh",
          display: "flex",
          flexDirection: 'column',
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography variant="article">Insira o texto da notícia no campo abaixo para verificar a veracidade da informação:</Typography>

        <TextField fullWidth sx={{width: '50%', mt: 2}} rows>

        </TextField>
      </Box>
    </Grid>
  );
}

export default App;
